import React from "react";
import NavigationBar from "../NavigationBar/NavigationBar";
import "./Portfolio.css";
function Tillster() {
  return (
    <div>
      <NavigationBar />
      <div className="projectsContainer">
        <h2 className="titleText">Tillster</h2>
        <p>
          Tillster is the global leader in powering digital ordering, delivery,
          couponing and loyalty solutions, across web, app, kiosk and call
          center platforms. The company empowers restaurant brands looking to
          increase revenue, achieve operational efficiencies, and better engage
          guests. Enabling nearly 50 million digital orders per year, it offers
          the added dimension of integrated marketing and data mining, including
          a proprietary AI and machine-learning tool.{" "}
        </p>
      </div>
    </div>
  );
}

export default Tillster;
